import React from "react";
import "./Chart.scss";

import LineChart from "/Line/Line";
import DoughnutChart from "/Doughnut/Doughnut";
import Aux from "../../../hoc/Aux";

const chart = (props) => {
  return (
    <div className="charts">
      <div className="line">
        <LineChart />
      </div>
      <div className="doughnut">
        <DoughnutChart />
      </div>
    </div>
  );
};
export default chart;
